import React, { Component } from "react";

class topTenDiv extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      position: "",
      comments: ""
    };
  }

  render() {
    const { players } = this.state;
    return players.map(player => {
      return (
        <div className="player-numbers">
          <div className="playerOne" id="playerOne">
            <img></img>
            <h3>
              {player.name}, {player.position}
            </h3>
            <span>{player.comments}</span>
          </div>
          <div className="playerTwo" id="playerTwo">
